    // let d = expenses;
    // console.log(d[0]);


    function fetchData() {
        fetch("https://s3-ap-southeast-1.amazonaws.com/he-public-data/studiod9c0baf.json").then(
            res => {
                return res.json();
            }
        ).then(
            data => {
                // console.log(data);
                setExpenses(data);
            }
        )
    }


    useEffect(() => {
        fetchData()
    }, []);


